import React from 'react'

export const Display = (props) => {
    return (
        <div style={{textAlign: 'right', padding: '10px', height: '50px', width: '90%', border: '1px solid red', margin: 'auto', marginTop: '30px'}}>
            {props.displayStr}
        </div>
    )
}

export const Button = (props) => {
    return (        
        <button value={props.value} style={{margin: '10px', width: '50px', height: '50px'}} onClick={props.click}>{props.display}</button>
    )
}
